Just to be clear as well, this affects the GraphQL API as well (which I was surprised about, tbh). When searching for a Pokemon normally you can get all of it's images just fine:

```gql
query GetImages {
  pokemon(where: {name: {_eq: "deerling"}}) {
    id
    name
    pokemonsprites {
      sprites
    }
  }
}
